import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_iphone.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_iphone.png'));

    // Wait for the search button (first visible .search-btn) and click it
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchBtn.click();

    // Wait for results heading to appear
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles from search results
    // Try both grid and list view selectors
    let productTitles = [];
    // Try grid view
    const gridCards = await page.$$('.products-grid .product-card .product-title');
    if (gridCards.length > 0) {
      for (const el of gridCards) {
        const title = await el.textContent();
        if (title) productTitles.push(title.trim());
      }
    } else {
      // Try list view
      const listCards = await page.$$('.products-list .product-card-list .product-title');
      for (const el of listCards) {
        const title = await el.textContent();
        if (title) productTitles.push(title.trim());
      }
    }

    // Filter for products with 'iPhone' in the title (case-insensitive)
    const matchedTitles = productTitles.filter(t => t.toLowerCase().includes('iphone'));

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted matching product titles from results",
      extractedData: {
        allProductTitles: productTitles,
        matchedIphoneTitles: matchedTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
